local library = loadstring(game:HttpGet(('https://raw.githubusercontent.com/AikaV3rm/UiLib/master/Lib.lua')))() local w = library:CreateWindow("Lightness Hub | v.1.0") local f1 = w:CreateFolder("Main") local f2 = w:CreateFolder("FPS") local f3 = w:CreateFolder("Setting") --
--
f1:Slider("Walk Speed",{ --
    min = 16; --
    max = 1000; --
    precise = true; --
},function(value)--
    game.Players.LocalPlayer.Character.Humanoid.WalkSpeed = value --
end) --
f1:Slider("Jump Power",{ --
    min = 50; --
    max = 1000; --
    precise = true; --
},function(value) --
    game.Players.LocalPlayer.Character.Humanoid.JumpPower = value --
end) --
f1:Button("Fly [E]",function() --
    loadstring(game:HttpGet('https://pastebin.com/raw/7rXZ9VNc'))()
    game.StarterGui:SetCore("SendNotification", {Title="Lightness X Hub"; Text="Activate E to fly"; Duration=5;}) --
end)
f1:Button("Teleport [Ctrl]",function()--
    loadstring(game:HttpGet("https://pastebin.com/raw/wtQjxtYp"))()
    game.StarterGui:SetCore("SendNotification", {Title="Lightness X Hub"; Text="Activate Ctrl to Teleport"; Duration=5;}) --
end)
f1:Button("Infinity Jump",function() --
    game.StarterGui:SetCore("SendNotification", {Title="Lightness X Hub"; Text="Activate Infinity Jump"; Duration=5;})
        local Player = game:GetService'Players'.LocalPlayer; --
    local UIS = game:GetService'UserInputService';
     --
    _G.JumpHeight = 50;
     
    function Action(Object, Function) if Object ~= nil then Function(Object); end end
     
    UIS.InputBegan:connect(function(UserInput)
        if UserInput.UserInputType == Enum.UserInputType.Keyboard and UserInput.KeyCode == Enum.KeyCode.Space then
            Action(Player.Character.Humanoid, function(self)
                if self:GetState() == Enum.HumanoidStateType.Jumping or self:GetState() == Enum.HumanoidStateType.Freefall then --
                    Action(self.Parent.HumanoidRootPart, function(self)
                        self.Velocity = Vector3.new(0, _G.JumpHeight, 0);--
                    end)
                end
            end)
        end
    end)
end) --
    --
f1:Box("Time","number",function(value)
    game.Lighting.ClockTime = value
    game.StarterGui:SetCore("SendNotification", {Title="Lightness X Hub"; Text="Set time to "..value; Duration=5;})--
end)
f2:Button("ESP",function()--
    loadstring(game:HttpGet("https://pastebin.com/raw/FxJTHia3"))()
    game.StarterGui:SetCore("SendNotification", {Title="Lightness X Hub"; Text="Activate Esp Player"; Duration=5;})--
end)
f3:DestroyGui() --
